generated.css:
@font-face {
  font-family: "Oswald";
  font-style: normal;
  src: url("https://fonts.googleapis.com/css?family=Oswald") format("woff2"), url("https://fonts.googleapis.com/css?family=Oswald") format("woff");
}
@font-face {
  font-family: "Staatliches";
  font-style: normal;
  src: url("https://fonts.googleapis.com/css?family=Staatliches") format("woff2"), url("https://fonts.googleapis.com/css?family=Staatliches") format("woff");
}
body {
  background: #25262B;
}

/* http://meyerweb.com/eric/tools/css/reset/ 
  v2.0 | 20110126
  License: none (public domain)
*/
html, body, div, span, applet, object, iframe,
h1, h2, h3, h4, h5, h6, p, blockquote, pre,
a, abbr, acronym, address, big, cite, code,
del, dfn, em, img, ins, kbd, q, s, samp,
small, strike, strong, sub, sup, tt, var,
b, u, i, center,
dl, dt, dd, ol, ul, li,
fieldset, form, label, legend,
table, caption, tbody, tfoot, thead, tr, th, td,
article, aside, canvas, details, embed,
figure, figcaption, footer, header, hgroup,
menu, nav, output, ruby, section, summary,
time, mark, audio, video {
  margin: 0;
  padding: 0;
  border: 0;
  font-size: 100%;
  font: inherit;
  vertical-align: baseline;
}

/* HTML5 display-role reset for older browsers */
article, aside, details, figcaption, figure,
footer, header, hgroup, menu, nav, section {
  display: block;
}

body {
  line-height: 1;
}

ol, ul {
  list-style: none;
}

blockquote, q {
  quotes: none;
}

blockquote:before, blockquote:after,
q:before, q:after {
  content: "";
  content: none;
}

table {
  border-collapse: collapse;
  border-spacing: 0;
}

.nav {
  background: green;
}

@media (min-width: 768px) and (max-width: 1023px) {
  .nav {
    background: yellow;
  }
}
@media (min-width: 1024px) {
  .nav {
    background: pink;
  }
}
@media (min-width: 1440px) {
  .nav {
    background: blue;
  }
}
